export default (state, action) => {
  switch (action.type) {
    
    case 'INDEX_ITEMS':
      return action.payload.map(  (item) =>
      <>
        {item.id}
        {item.nome}
        {item.desc}
        {item.preco}
      </>
      );

    default:
      return state;
  }
}
